    false,nt"url": null,nt"notes": "This narrative report for Trempealeau NWR
    outlines Refuge accomplishments from August through October of 1941. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, and furbearers-
    is also covered. The Refuge development and maintenance section discusses plantings
    and collections and receipts. The public relations section of the report describes
